import React, { Component} from 'react';
import  InputRange  from './InputSlider';

class noValueSlider extends Component {
    state = {
        value: 50,
    }
    handleOnChange = (e) => this.setState({value: e.target.value})

    render() {
        return (
            <form className="form">                
                <InputRange />
            </form>
        );
    }
}


export default noValueSlider;
